import React,{ useState , useEffect} from 'react'

function AllBookings() {

    const [formDetail,setFormDetail]=useState([]);
     
    useEffect(()=>{
            const getAllDetails=async()=>{
                try{
                    const response=await fetch("http://localhost:5000/api/bookings/bookingdetail");
                    const responseData = await response.json();
                    if (!response.ok) {
                        throw new Error(responseData.message);
                      }
                      else {
                        setFormDetail(responseData.bookingDetail);
                        console.log(responseData.bookingDetail);
                      }
                }catch(err){
                    console.log(err.message);
                }
            };

            getAllDetails();


    },[]);

  return (
    <div>
         <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Post</th>
              <th>Id</th>
              <th>Current City</th>
              <th>Current District</th>
              <th>Current State</th>
              <th>Current Pincode</th>
              <th>Mobile No</th>
              <th>Purpose</th>
              <th>Permanent House</th>
              <th>Permanent Street</th>
              <th>Permanent City </th>
              <th>Permanent District</th>
              <th>Permanent State</th>
              <th>Permanent Pincode</th>
              <th>Start Date</th>
              <th>End Date</th>
              <th>Floor</th>
              <th>Relative Name</th>
              <th>Relative Id</th>
              <th>Relative Age</th>
              <th>Relative Relation</th>
            </tr>
          </thead>
          <tbody>
            {formDetail.map((applicant, index) => (
              <tr key={parseInt(index)}>
                <td>{applicant.name}</td>
                <td>{applicant.post}</td>
                <td>{applicant.id}</td>
                <td>{applicant.city}</td>
                <td>{applicant.district}</td>
                <td>{applicant.state}</td>
                <td>{applicant.pincode}</td>
                <td>{applicant.mobile}</td>
                <td>{applicant.purpose}</td>
                <td>{applicant.permanentHouse}</td>
                <td>{applicant.permanentStreet}</td>
                <td>{applicant.permanentCity }</td>
                <td>{applicant.permanentDistrict}</td>
                <td>{applicant.permanentState}</td>
                <td>{applicant.permanentPincode}</td>
                <td>{applicant.startDate}</td>
                <td>{applicant.endDate}</td>
                <td>{applicant.floor}</td>
                <td>{applicant.personName}</td>
                <td>{applicant.personId}</td>
                <td>{applicant.personAge}</td>
                <td>{applicant.personRelative}</td>
              </tr>
            ))}
          </tbody>
        </table>
    </div>
  )
}

export default AllBookings;
